  console.log(usableCoinData);
  return (
    <div>
      <ul>
        <li>
          {`Bitcoin rate for ${props.bpi.bpi.USD.description} : ${props.bpi.bpi.USD.symbol}${props.bpi.bpi.USD.rate}`}
        </li>
      </ul>
    </div>
  );
};

export default Prices;
